    timespec start, finish;
    double elapsed;
    clock_gettime(CLOCK_MONOTONIC, &start);
    double worktime;
    std::vector<RawSequence> reads = {RawSequence("read1", ""),
                                      RawSequence("read2", "")};
    std::string s = ""
                    "";
    s = reads[0].seq + s;
    std::vector<RawSequence> ref = {RawSequence("Ref", s)};
    NoTranslator translator;
    for(size_t i = 0; i < 125; i++) {
        Aligner aligner;
        aligner.prepare(ref);
        aligner.alignAndTranslate(reads, translator);
    }
    clock_gettime(CLOCK_MONOTONIC, &finish);
    worktime = double(finish.tv_sec - start.tv_sec) + double(finish.tv_nsec - start.tv_nsec) / 1000000000.0;
    std::cout << "Index reloaded " << worktime << std::endl;
    assert(worktime <= 8);
    clock_gettime(CLOCK_MONOTONIC, &start);
    Aligner aligner1;
    aligner1.prepare(ref);
    for(size_t i = 0; i < 125; i++) {
        aligner1.alignAndTranslate(reads, translator);
    }
    clock_gettime(CLOCK_MONOTONIC, &finish);
    worktime = double(finish.tv_sec - start.tv_sec) + double(finish.tv_nsec - start.tv_nsec) / 1000000000.0;
    std::cout << "Default " << worktime << std::endl;
    assert(worktime <= 8);
    std::vector<RawSequence> many_reads;
    for(size_t i = 0; i < 1000; i++) {
        many_reads.push_back(reads[0]);
        many_reads.push_back(reads[1]);
    }
    clock_gettime(CLOCK_MONOTONIC, &start);
    Aligner aligner2(8);
    aligner2.prepare(ref);
    aligner2.alignAndTranslate(many_reads, translator);
    clock_gettime(CLOCK_MONOTONIC, &finish);
    worktime = double(finish.tv_sec - start.tv_sec) + double(finish.tv_nsec - start.tv_nsec) / 1000000000.0;
    std::cout << "8 threads " << worktime << std::endl;
    assert(worktime <= 8);
    return 0;
